A2: In which language is this program written?

<hlcode>float angle = 0;

void setup() {
  size(130, 130, OPENGL);
}

void draw() {
  background(100);

  translate(60, 40, 0);
  rotateY(angle);
  angle += .01;

  beginShape(TRIANGLES);
  vertex(0, 40, 0);
  vertex(40, 40, 0);
  vertex(20, 0, -20);

  vertex(0, 40, 0);
  vertex(20, 40, -40);
  vertex(20, 0, -20);

  vertex(40, 40, 0);
  vertex(20, 40, -40);
  vertex(20, 0, -20);
  endShape();
}
</hlcode>

